IF OBJECT_ID('tempdb..#ADTHospitalMaster') IS NOT NULL
 DROP TABLE #ADTHospitalMaster
 
CREATE TABLE #ADTHospitalMaster(
		ADTHospitalMasterId			int			NOT NULL,
		CreatedBy					varchar(30) NOT NULL,
		CreatedDate					datetime NOT NULL,
		ModifiedBy					varchar(30) NOT NULL,
		ModifiedDate				datetime NOT NULL,
		RecordDeleted				char(1) NULL,
		DeletedBy					varchar(30) NULL,
		DeletedDate					datetime NULL,
		HospitalName				varchar(250) NULL,
		SendingFacilityIdentifier	varchar(500) NULL,
		HealthSystem				varchar(500) NULL,
		ADT							varchar(5) NULL
		)







set identity_insert [ADTHospitalMaster] ON
[ADTHospitalMasterId]
,[CreatedBy]
,[CreatedDate]
,[ModifiedBy]
,[ModifiedDate]
,[RecordDeleted]
,[DeletedBy]
,[DeletedDate]
,[HospitalName]
,[SendingFacilityIdentifier]
,[HealthSystem]
,[ADT]
)
SELECT 

T.ADTHospitalMasterId
,T.CreatedBy
,T.CreatedDate
,T.ModifiedBy
,T.ModifiedDate
,T.RecordDeleted
,T.DeletedBy
,T.DeletedDate
,T.HospitalName
,T.SendingFacilityIdentifier
,T.HealthSystem
,T.ADT
FROM #ADTHospitalMaster T
WHERE NOT EXISTS(SELECT 1 FROM ADTHospitalMaster M WHERE M.HospitalName=T.HospitalName AND ISNULL(M.RecordDeleted,'N')='N')

set identity_insert [ADTHospitalMaster] off
Go



